import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Paper,
  useTheme,
  Link,
  CircularProgress,
  IconButton,
  Tooltip,
  Snackbar
} from '@mui/material';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CancelIcon from '@mui/icons-material/Cancel';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import TwitterIcon from '@mui/icons-material/Twitter';
import { getPairXToken } from '../../utils/helpers';
import axios from 'axios';

const TokenInformation = ({ tokenAddress }) => {
  const [tokenInfo, setTokenInfo] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [copySuccess, setCopySuccess] = useState(false);

  useEffect(() => {
    const fetchTokenInfo = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`https://api.jup.ag/tokens/v1/token/${tokenAddress}`);
        console.log('Token info response:', response.data); // Debug log
        setTokenInfo(response.data);
      } catch (err) {
        console.error('Error fetching token info:', err);
        setError('Failed to fetch token information');
      } finally {
        setLoading(false);
      }
    };

    if (tokenAddress) {
      fetchTokenInfo();
    }
  }, [tokenAddress]);

  const handleCopyAddress = async () => {
    try {
      await navigator.clipboard.writeText(tokenAddress);
      setCopySuccess(true);
      setTimeout(() => setCopySuccess(false), 2000);
    } catch (err) {
      console.error('Failed to copy:', err);
    }
  };

  const getTwitterSearchUrl = (address) => {
    return `https://x.com/search?q=${address}&src=typed_query`;
  };

  const formatAddress = (address) => {
    return `${address.slice(0, 4)}...${address.slice(-4)}`;
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 2 }}>
        <CircularProgress size={24} />
      </Box>
    );
  }

  if (error) {
    return <Typography color="error">{error}</Typography>;
  }

  if (!tokenInfo) {
    return <Typography color="text.secondary">Token information not found</Typography>;
  }

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    const date = new Date(dateString);
    return date.toLocaleDateString(undefined, { 
      year: 'numeric',
      month: 'short',
      day: 'numeric'
    });
  };

  const SecurityIndicator = ({ isSecure, label }) => (
    <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
      <Typography color="text.secondary">{label}</Typography>
      <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
        {isSecure ? (
          <>
            <CheckCircleIcon color="success" sx={{ fontSize: '1.2rem' }} />
            <Typography color="success.main">Secure</Typography>
          </>
        ) : (
          <>
            <CancelIcon color="error" sx={{ fontSize: '1.2rem' }} />
            <Typography color="error.main">Risk</Typography>
          </>
        )}
      </Box>
    </Box>
  );

  return (
    <Grid container spacing={2}>
      {/* Token Header with Address */}
      <Grid item xs={12}>
        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: 'space-between', 
          mb: 2 
        }}>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            {tokenInfo.logoURI && (
              <img 
                src={tokenInfo.logoURI} 
                alt={tokenInfo.symbol} 
                style={{ width: 32, height: 32, borderRadius: '50%' }}
              />
            )}
            <Box>
              <Typography variant="h6">{tokenInfo.symbol}</Typography>
              <Typography variant="body2" color="text.secondary">{tokenInfo.name}</Typography>
            </Box>
          </Box>

          <Box sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            gap: 1,
            bgcolor: 'action.selected',
            p: 0.5,
            borderRadius: 1,
            height: 'fit-content'
          }}>
            <Typography 
              variant="body2" 
              sx={{ 
                fontFamily: 'monospace',
                color: 'text.secondary'
              }}
            >
              {formatAddress(tokenAddress)}
            </Typography>
            <Tooltip title="Copy Address">
              <IconButton 
                size="small" 
                onClick={handleCopyAddress}
                sx={{ color: 'text.secondary' }}
              >
                <ContentCopyIcon fontSize="small" />
              </IconButton>
            </Tooltip>
            <Tooltip title="Search on Twitter">
              <IconButton 
                size="small"
                component="a"
                href={getTwitterSearchUrl(tokenAddress)}
                target="_blank"
                rel="noopener noreferrer"
                sx={{ color: 'text.secondary' }}
              >
                <TwitterIcon fontSize="small" />
              </IconButton>
            </Tooltip>
          </Box>
        </Box>
      </Grid>

      {/* Token Details */}
      <Grid item xs={12}>
        <Grid container spacing={2}>
          {/* Token Info */}
          <Grid item xs={12}>
            <Typography variant="subtitle2" gutterBottom sx={{ color: 'primary.main' }}>
              Token Info
            </Typography>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
              <Typography color="text.secondary">Decimals</Typography>
              <Typography>{tokenInfo.decimals}</Typography>
            </Box>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
              <Typography color="text.secondary">Created</Typography>
              <Typography>{formatDate(tokenInfo.created_at)}</Typography>
            </Box>
            {tokenInfo.minted_at && (
              <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                <Typography color="text.secondary">Minted</Typography>
                <Typography>{formatDate(tokenInfo.minted_at)}</Typography>
              </Box>
            )}
          </Grid>

          {/* Security Info */}
          <Grid item xs={12}>
            <Typography variant="subtitle2" gutterBottom sx={{ color: 'primary.main' }}>
              Security Info
            </Typography>
            <SecurityIndicator 
              isSecure={!tokenInfo.mint_authority} 
              label="Mint Authority"
            />
            <SecurityIndicator 
              isSecure={!tokenInfo.freeze_authority} 
              label="Freeze Authority"
            />
          </Grid>

          {/* Tags */}
          {tokenInfo.tags && tokenInfo.tags.length > 0 && (
            <Grid item xs={12}>
              <Typography variant="subtitle2" gutterBottom sx={{ color: 'primary.main' }}>
                Tags
              </Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                {tokenInfo.tags.map((tag, index) => (
                  <Typography 
                    key={index} 
                    variant="body2" 
                    sx={{ 
                      bgcolor: 'action.selected',
                      px: 1,
                      py: 0.5,
                      borderRadius: 1
                    }}
                  >
                    {tag}
                  </Typography>
                ))}
              </Box>
            </Grid>
          )}
        </Grid>
      </Grid>

      {/* Copy Success Snackbar */}
      <Snackbar
        open={copySuccess}
        autoHideDuration={2000}
        onClose={() => setCopySuccess(false)}
        message="Address copied to clipboard"
        anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
      />
    </Grid>
  );
};

const ExpandedRow = ({ pair }) => {
  const theme = useTheme();
  const pairXToken = getPairXToken(pair);

  const getSolscanLink = (address) => `https://solscan.io/address/${address}`;

  return (
    <Box sx={{ p: 3, backgroundColor: theme.palette.background.default }}>
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Pair Details
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <Typography color="text.secondary">Pair Address</Typography>
                <Link
                  href={getSolscanLink(pair.address)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.address}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Token X Address</Typography>
                <Link
                  href={getSolscanLink(pair.tokenX)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.tokenX}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Token Y Address</Typography>
                <Link
                  href={getSolscanLink(pair.tokenY)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.tokenY}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">Base Fee</Typography>
                <Typography variant="body2">{pair.baseFee}%</Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">Bin Step</Typography>
                <Typography variant="body2">{pair.binStep}</Typography>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Status</Typography>
                <Typography 
                  variant="body2" 
                  sx={{ 
                    color: pair.is_blacklisted ? 'error.main' : 'success.main'
                  }}
                >
                  {pair.is_blacklisted ? 'Blacklisted' : 'Active'}
                </Typography>
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Token Information
            </Typography>
            {pairXToken ? (
              <TokenInformation tokenAddress={pairXToken.address} />
            ) : (
              <Typography color="text.secondary">
                No token information available
              </Typography>
            )}
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Performance Metrics
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}>
                <Typography color="text.secondary">30min Volume</Typography>
                <Typography variant="body2">
                  ${Number(pair.volume30min).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">30min Fees</Typography>
                <Typography variant="body2">
                  ${Number(pair.fees30min).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">24h Fees</Typography>
                <Typography variant="body2">
                  ${Number(pair.fees24h).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">APR</Typography>
                <Typography variant="body2">
                  {Number(pair.apr).toLocaleString()}%
                </Typography>
              </Grid>
            </Grid>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ExpandedRow;
